import React from 'react';

const ImageCarosel = () => (
    <div className='image-carosel'>
        <div className='images-thumbnails'>
            <div><img src="https://i.etsystatic.com/19638897/r/il/d761a2/1877667416/il_794xN.1877667416_jqd1.jpg"/></div>
            <div><img src='https://i.etsystatic.com/19638897/r/il/07b5a5/1925189021/il_794xN.1925189021_el8b.jpg'/></div>
        </div>
        <div className='image-main-viewer'>
            <img src="https://i.etsystatic.com/19638897/r/il/e76d79/1877667482/il_1588xN.1877667482_gjv6.jpg"/>
        </div>
    </div>
)
export default ImageCarosel;
